def rolling_max(numbers: List[int]) -> List[int]:

    rolling_maxes = []

    if len(numbers) == 0:
        return []

    running_max = numbers[0]
    start, end = 0, 1

    while end < len(numbers):
        if numbers[end] > running_max:
            running_max = numbers[end]
        else:
            while running_max not in rolling_maxes:
                rolling_maxes.append(running_max)
            running_max = numbers[end]

        rolling_maxes.append(running_max)
        start, end = end, end + 1

    while running_max not in rolling_maxes:
        rolling_maxes.append(running_max)
    running_max = numbers[end]

    return rolling_maxes

