def find_closest_elements(numbers: List[float]) -> Tuple[float, float]:

    def distance(x, y):
        return abs(x - y)

    closest = None
    second_closest = None
    for n in numbers:
        if closest is None:
            closest = n
        else:
            new_distance = distance(n, closest)
            if new_distance < distance(n, second_closest):
                second_closest = n
    if second_closest is None:
        return (closest,)
    return (closest, second_closest)

